/*Table structure for table `police_data` */

DROP TABLE IF EXISTS `police_data`;

CREATE TABLE `police_data` (
  `id` int(11) NOT NULL auto_increment,
  `id_no` text,
  `name` text,
  `email` text,
  `mobile` text,
  `password` text,
  `date` text,
  `image` longblob,
  `status` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

